import React from 'react';
import ReactDOM from 'react-dom/client';  // Use ReactDOM.createRoot in React 18
import App from './App'; // Import App

// Create a root for rendering the app
const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
  <App />  // Just render the App component, no need to wrap it in BrowserRouter again
);
